import React from "react";
import s from './MyPosts.module.css'
import Post from "./Post/Post";

const MyPosts = (props) => {
    // let posts =[
    //     {text:'Hi, how are you?', id:'1', likes: 15},
    //     {text:'Oh, thanks. I\'m fine)', id:'2', likes: 25}
    // ]
    let postElements = props.posts.map(s => <Post messages = {s.text} like = {s.likes}/>);
    return (
        <div className={s.posts}>
            <div>
                <div>
                    <textarea name="" id="" cols="20" rows="3"/>
                </div>
                <button>Add post</button>
            </div>
            <div>
                {postElements}
            </div>
        </div>
    );
}
export default MyPosts;
